import React, { useEffect } from 'react'
import Aos from "aos"
import "aos/dist/aos.css"

function LoadingBar() {

    useEffect(() => {
        Aos.init({
            duration: 2000
        });
    }, []);
    return (
        <div data-aos="fade-right">
            <div class="progress">
                <div class="progress-bar bg-dark" role="progressbar" aria-valuenow="70" aria-valuemin="0" aria-valuemax="100">70%</div>
            </div>
        </div>
    )
}

export default LoadingBar
